import { Component } from "./Component";
import { useGlobalContext } from "./context";
const AllComponents = () => {
  const { state } = useGlobalContext();
  return (
    <div>
      {state.coloumns.map((item, index) => {
        return (
          <div>
            <Component name={item} />
            <p>---------------------------------------------------------</p>
          </div>
        );
      })}
    </div>
  );
};

export default AllComponents;
